    [],nt"revision_timestamp": "2016-05-31T01:08:45.259673",nt"name": "afsc-fma-observer-logistics-system-ols",nt"isopen":
    false,nt"url": null,nt"notes": "Alaska groundfish fisheries observers have
    been monitoring domestic groundfish fishing activities in the U.S. Exclusive Economic
    Zone (EEZ) off Alaska for over twenty years. The Fisheries Monitoring and Analysis
    Division staff has been responsible for training, briefing, debriefing and oversight
    of these observers.  The Observer Logistics System, launched in December 2011, is
    the current computer tool used for observer logistics and contains data on individual
    observers back to 1990.",nt"license_title": null,nt"extras": [{ntt"key":
